  true,\n\t\"url\": null,\n\t\"notes\": \"This SBIR phase I project proposes a tunable
  single frequency highnenergy fiber laser system for coherent Lidar systems for remote
  sensing.nCurrent state-of-art technologies can not provide all features of highnenergy
  and efficiency, compactness, narrow linewidth, super frequencynand power stability,
  low noise, and high extinction ratio at the samentime. PolarOnyx proposes, for the
  first time, a fast tuningn(sub-microsecond) high energy (100 mJ) single frequency
  (&amp;lt; 1 KHz)nfiber laser transmitter to meet with the requirement of solicitation.
  Itnis a specialty fiber based MOPA operating at 1550 nm. The mode selectionnin seed
  fiber laser is achieved by using an EO polymer based ultrannarrow bandpass tunable
  filter. The output power can be scalable tonseveral hundreds mW without any spatial
  hole burning issues and thenfrequency can be controlled at a stable and accurate
  operation. In thenamplifier stage, PolarOnyx proposes a revolutionary approach tonfundamentally
  resolve the issues of nonlinear effects by employing ournpatent pending proprietary
  technologies in fiber lasers. Our uniquenspectral shaping techniques enable us to
  reduce the SBS and ASE noisensignificantly in the amplifier for commercially available
  EYDFs and tonreuse the residual pump to further increase the efficiency. These willnmake
  the fiber laser transmitter system superior in terms of wall plugnefficiency (over
  30&amp;#37;), energy(100 mJ), noise, size, and cost.  Antabletop experiment will
  be demonstrated in Phase I time frame for proofnof concept. A compact prototype
  will be delivered in Phase II.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
